C.a0S=new H.p(82,{helloWorld:"Hello World!",license:"License",search:"Search",help:"Help",privacy:"Privacy",terms:"Terms",sure:"Sure",cancel:"Cancel",home:"Home",settings:"Settings",darkTheme:"Dark Theme",auto:"Auto",about:"About",language:"Language",version:"Version",framework:"Framework",distTechnique:"Dist Technique",profile:"Profile",source:"Source",copy:"Copy",paste:"Paste",more:"More","@personDescription":"A normal software engineer and communication engineer. \nCurrently live in GuangZhou-GuangDong, China. Working for China Telecom. \nEnjoy music and e-game. NS is my favorite. Try to be a better UI designer now. \nHopefully become a true master some day. \n",background:"Background",skill:"Skill",other:"Other","@backgroundDescription":"About my education and experiment?\nWhere did I graduate from?\nWhat's my major?\nWhat have I done?","@skillDescription":"About my skills and ability\nWhat can I do?\nWhat's my tech stack?\nWhere's my focus?","@otherDescription":"About my other stuff\nWhat's my hobby?\nOr somethings else?",visit:"Visit",toVisitOtherWebsite:"To visit other website",education:"Education",experiment:"Experiment",tapAndExplore:"Tap and explore",alert:"Alert",useChromeForBetterExperiment:"Use Chrome for better experiment",born:"Born",favorite:"Favorite",contactMe:"Contact Me",university:"University",JNU:"JiNan University",fourYearFullTime:"four-year full-time",internetOfThings:"Internet of Things",technologyStack:"Technology Stack",programmingLanguage:"Programming Language",supportedPlatform:"Supported Platform",otherRelatedStuff:"Other Related Stuff",signalProcessing:"Signal Processing",digitalSignalProcessing:"Digital Signal Processing",digitalImageProcessing:"Digital Image Processing",circuits:"Circuits",analogCircuits:"Analog Circuits",digitalCircuits:"Digital Circuits",programming:"Programming",hardwareLanguage:"Hardware Language",softwareLanguage:"Software Language",computerNetwork:"Computer Network",embeddedSystem:"Embedded System",desktop:"Desktop",mobile:"Mobile",usedFramework:"Used Framework",whatIsMyAdvantage:"What is my advantage?","@myAdvantageDescription":"Wide technology support. \n\n  I can offer multi techniques support and technology integration. In a most common problem, different staff from different tech divisions can't communication between each other because of lack tech background knowledge of side other. But I would not.\n  Although I can't use all this technique as skilled as a dedicated pro technical staff at the beginning, I can switch among and into them easily. I can develop any projects of my felids. \n  But that is not meaning I can't develop independently. I can develop as normal developer alone, bundle all the stuff together and distribute a full production. \n",learning:"Learning",interest:"interest",database:"Database","@databaseDescription":'This question just like asking me: "Did you save money in certain bank?". \n  "I have not done. " as my answer. \n  Different situations need different type databases. Even same type databases have their own implements with different apis or SQL language. \n  Map / Tree / Relational database is the most common type database. And each type have several famous productions in the market. I have not used them all in my short life. \n  Or I just don\'t care database. It\'s just a simple tool to save my data and should be like that. ',machineLearning:"Machine Learning","@machineLearningAndAIDescription":"I know a bit. I'm familiar with the underlay some algorithm and constructions of machine learning. \n  When I was in the university, I was very interesting about this and learning a lot of relative theories. I have write a native c program \"Image recognize based on machine learning\" that ran on a STM32M3 development board. \n  But I wish you clam down. ML is not magic that can't finish any your whimsical ideas and it consume a lot of computer resource, time and people resource that only can reach the business production level. \n  If your company don't focus on it but want integrate it into own production, I recommend you try Google's ML Kit. \n  Of course, I'm glad to join your AI team and receive more salary. Because I need more pay to appease myself while I want to try new stuff but be requested to some repetitive work like a test engineer and try hard to optimize production like a framework developer. ",coverage:"Coverage",signalAndCommunication:"Signal and Communication",electronicCircuit:"Electronic Circuit",computerScience:"Computer Science",embeddedEngineer:"Embedded Development Engineer",communicationsEngineer:"Communications Engineer",practice:"Practice",myHobbies:"My Hobbies",myExpectation:"My Expectation","@myExpectationDescription":" I don't want to be only certain developer. I want to try and deep dive into every direction technology. And bundle them together. The road is more suitable for my style and my major. \n  As long as enough freedom of development for me, I can handle almost every normal thing by myself (except center or complex problems). I'm suitable for development only. \n  And image processing is my most interesting felid. I'm glad to join into the felid and offer my ability. ",game:"Game",electronicProduction:"Electronic Production",preferIde:"Prefer IDE"},C.Vq,t.w)
